import React, { Fragment } from 'react'
import { Button, Form, FormGroup, Input, Container, Table, Pagination, PaginationItem, PaginationLink  } from 'reactstrap'
// import { BootstrapTable } from './BootstrapTable'
import SpotifyTable from './SpotifyTable'
import BootstrapTable from 'react-bootstrap-table-next';
import paginationFactory from 'react-bootstrap-table2-paginator'


export default class Home extends React.Component {
    constructor(props) {
        super(props)
        // var { songData, columns } = this.props
        // songData = ["Party in the USA", "Burnin Up", "Tik Tok", "Fireflies", "Dynamite", "Cooler than Me", "Toxic", "If U Seek Amy", "Umbrella"]
        // columns = [{ dataField: 'id', text: 'Songs' }];
        // const products = ["Party in the USA", "Burnin Up", "Tik Tok", "Fireflies", "Dynamite", "Cooler than Me", "Toxic", "If U Seek Amy", "Umbrella"]
        // const columns = [{
        // dataField: 'id',
        // text: 'Songs'
        // }];
        this.state = {
            columns: []
        }

    }

    componentDidMount() {
        var { songData, columns } = this.props
        songData = ["Party in the USA", "Burnin Up", "Tik Tok", "Fireflies", "Dynamite", "Cooler than Me", "Toxic", "If U Seek Amy", "Umbrella"]
        this.setState({
            columns: [{ dataField: 'title', text: 'Songs in Common'}]
        }) 
    }

    render () {
        return (
            <Container>
                {console.log(this.props.columns)}

                <h1 className="mt-5 mb-5">Application Name</h1>

                <Form>
                    <FormGroup>
                        <Input type="text" placeholder="login_username else placeholder text" className="form-control" required></Input>
                    </FormGroup>                    
                    <FormGroup>
                        <Input type="text" placeholder="Enter another username" className="form-control" required></Input>
                    </FormGroup>
                    <FormGroup>
                        <Button className="btn btn-primary btn-lg btn-block">Compare data</Button>
                    </FormGroup>
                </Form>

                <div>
                    <Table bordered>
                        <thead>
                            <tr>
                            <th>Songs in Common</th>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                            <td>Party in the USA</td>
                            </tr>
                        </tbody>
                    </Table>
                    <Pagination aria-label="Page navigation example">
                        <PaginationItem>
                            <PaginationLink first href="#" />
                        </PaginationItem>
                        <PaginationItem>
                            <PaginationLink previous href="#" />
                        </PaginationItem>
                        <PaginationItem>
                            <PaginationLink href="#">
                            1
                            </PaginationLink>
                        </PaginationItem>
                        <PaginationItem>
                            <PaginationLink href="#">
                            2
                            </PaginationLink>
                        </PaginationItem>
                    </Pagination>
                </div>



                {/* <div>
                <Fragment>
                    <SpotifyTable
                    data={this.props.songData}
                    pageSize={this.props.songData.pageSize}
                    pagesCount={this.props.songData.pagesCount}
                    currentPage={this.props.songData.currentPage - 1}
                    handlePageClick={this.handlePageClick}
                    handlePreviousClick={this.handlePreviousClick}
                    handleNextClick={this.handleNextClick}
                    />
                </Fragment>
                </div> */}


                <div>
                    {/* <BootstrapTable />  */}
                    <BootstrapTable keyField='id' data={ [{ id: 0, title: "song0" }, { id: 2, title: "song2" }, { id: 4, title: "song4" }] } columns={ this.state.columns } pagination={ paginationFactory() } />
                </div>




            </Container>
        )
    }

}
